import React, { Component } from 'react';
import { render } from 'react-dom';
import { Link,withRouter } from 'react-router-dom';
import Web3 from 'web3';
import './App.css';
const teachers=[{tid:1,name:"lahari",sid:1,sub:"math"},{tid:1,name:"lahari",sid:1,sub:"math"}]

class manageteacher extends Component{

render() {
    return (



      <div class="container">          
      <center><h1 class="mt-4 pt-4">Teachers</h1></center>
      <div classname="teachers">
   {teachers.map((teacher,index)=>(
     <div key={index}>
<div class="card bg-light">
      <div class="card-body">

        <button class="btn btn-secondary float-right" style={{borderRadius: 20, height: 40,width: 125, marginTop: 6}} >Unblock</button>
   <div class="h3 d-inline">{teacher.name}</div>
        <div class="small">{teacher.sub}</div>

      </div>
    </div>
     </div>
   ))}

    </div>
  </div>
    );
  }
}

export default withRouter(manageteacher);
